import Header from './Header';

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
};

const navbarCollapse = {
  display: block,
  height: auto,
  padding: 0,
  overflow: visible
}
export default function Layout(props) {
return (
    <div style={layoutStyle}>
      <Header />
      {props.children}
    </div>
  );
}
